using System;
using Xunit;
using System.Collections.Generic;
using System.Text;
using Xunit.Abstractions;
using DataProcessingCenter.DataProcessor;

namespace DataProcessingCenter.Tests
{
    public class SuitableBlockDataTests
    {
        ITestOutputHelper outPut;
        public SuitableBlockDataTests(ITestOutputHelper outPut)
        {
            this.outPut = outPut;
        }

        [Fact]
        public void SuitableBlockData_ShortWork()
        {
            string testString = "asdfsdfsdaljlkjcvlkzcjvkczxljzklxcjvklxzjvklsadjflksdjfklsdajfslkdjfsldkafsdklfjsdlkafjsdaklfjsadklfjsdafklasjdf";
            outPut.WriteLine(testString.Length.ToString());
            var sbd = new SuitableBlockData();
            var result = sbd.GetArrayListForSaving(testString);
            Assert.Equal(result.Count, 1);
            Assert.Equal(result[0], testString);
        }

        [Fact]
        public void SuitableBlockData_LongWork()
        {
            string testString = "";
            byte[] bytes = Encoding.Default.GetBytes(testString);
            outPut.WriteLine(bytes.Length.ToString());
            var sbd = new SuitableBlockData(31774);
            var results = sbd.GetArrayListForSaving(testString);
            string str = null;
            foreach (var item in results)
            {
                byte[] bytes1 = Encoding.Default.GetBytes(item);
                outPut.WriteLine(bytes1.Length.ToString());
                str += item;
            }
            Assert.Equal(str, testString);
        }
    }
}
